	pdf.ClipPolygon([]gofpdf.PointType{{80, y + 20}, {90, y},
		{100, y + 20}}, true)
	pdf.LinearGradient(80, y, 20, 20, 250, 220, 250, 60, 40, 60, 0.5,
		1, 0.5, 0.5)
